/* eslint-disable jsx-a11y/anchor-is-valid */
import React from "react";

const ReserveButton01 = ({ imgSrc, text, onClick }) => {
  return (
    <a className="nav-link" onClick={onClick}>
      <img src={imgSrc} alt={text} /> {text}
    </a>
  );
};

export default ReserveButton01;
